public class MultiplyTwoIntegers {
	

	public int MultiplyTwoIntegers(int i, int j) {
		// TODO Auto-generated method stub
		return i*j;
	}
	public int DivideTwoIntegers(int i, int j) {
		// TODO Auto-generated method stub
		int res=i/j;
		return res;
	}
	

}
